import React from 'react';

import './journal.scss';

interface Props {
    data?: {};
}

const Journals: React.FC<Props> = (props) => {
    const results: any = props.data;
    delete results['uids'];

    console.log(results);
    return (
        <>
            <div>
                {Object.keys(results).map((key) => (
                    <div className="journal" key={key}>
                        <h3 className="journal-title">{results[key].title}</h3>
                        {results[key].fulljournalname && <p className="journal-name">In: {results[key].fulljournalname}</p>}
                        <p className="journal-pubDate">{results[key].pubdate}</p>
                        <div className="journal-author">By: {results[key].authors.map((el: any) => <p>{el.name}</p>)}</div>
                        <a className="journal-link" href={`https://pubmed.ncbi.nlm.nih.gov/${results[key].uid}`}>View journal</a>
                    </div>
                ))}
            </div>
        </>
    );
};

export default Journals;
